import React from "react";
import Spinner from "../Spinner";

const AddContact = () => {
  return (
    <>
      {loading ? (
        <Spinner />
      ) : (
        <>
          <section className="p-3">
            <img
              src={require("../../assets/man-taking-note.png")}
              height="400px"
              style={{
                position: "absolute",
                zIndex: "-1",
                top: "130px",
                left: "100px",
                opacity: "50%",
              }}
            />
          </section>
        </>
      )}
    </>
  );
};

export default AddContact;
